/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `cars_BEFORE_INSERT` BEFORE INSERT ON `cars` FOR EACH ROW BEGIN
	IF((SELECT count(*) FROM models WHERE NEW.models_id = models.id) = 0) THEN
		SIGNAL SQLSTATE '45000';
	END IF;
    IF((SELECT count(*) FROM cars WHERE NEW.`number` = cars.`number`) > 0) THEN
		SIGNAL SQLSTATE '45000';
	END IF;
END */;;
